import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>this is App</p>
        <h1>
          <FetchRandom />
        </h1>
      </header>
    </div>
  );
}

class FetchRandom extends React.Component {
  render() {
    return <div>user...</div>;
  }
}

export default App;
